import React from 'react';
import "./Nav.css"
import rose from "./rose.jpg"

const Nav = () => {
    return (
        <div className='nav'>
            <nav class="navbar navbar-light bg-light">
  <a class="navbar-brand" href="#">
    <img src={rose} width="60" height="40" class="d-inline-block align-top" alt=""/>
    Bootstrap
  </a>
</nav>

        </div>
    );
}

export default Nav;
